import React from 'react';
import swlogo from '../../assets/logo.svg';

export const Header = () => {
  return (
    <header className="flex items-center">
      <img
        src="https://fontmeme.com/permalink/200116/6eb0147ce91ef21bed55cdf6ce4d71ad.png"
        class="flex items-center my-4"
      />
    </header>
  );
};
